import React from 'react';
import Dashboard from './components/Dashboard';
import Chart from './components/Chart';
import Alerts from './components/Alerts';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Gilet Intelligent pour Bébé</h1>
      </header>
      <Dashboard />
      <Chart />
      <Alerts />
    </div>
  );
}

export default App;
